import React, { useState } from 'react';
import axios from 'axios';

function RegisterForm() {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [email, setEmail] = useState('');

  const handleSubmit = async (event) => {
    event.preventDefault();
    console.log('handleSubmit appelé avec :', { username, password, email });

    try {
      // Envoyer les données d'inscription à l'API back-end
      const response = await axios.post('/users', { username, password, email });

      // Gérer la réponse (par exemple, afficher un message de succès, rediriger l'utilisateur)
      console.log('Inscription réussie', response.data);
    } catch (error) {
      console.error("Erreur lors de l'inscription :", error.response ? error.response.data : error.message);
    }
  };

  return (
    <div>
      <h1>Inscription</h1>
      <form onSubmit={handleSubmit}>
        <label>
          Nom d'utilisateur:
          <input type="text" value={username} onChange={e => setUsername(e.target.value)} />
        </label>
        <label>
          Mot de passe:
          <input type="password" value={password} onChange={e => setPassword(e.target.value)} />
        </label>
        <label>
          Email:
          <input type="email" value={email} onChange={e => setEmail(e.target.value)} />
        </label>
        <button type="submit">S'inscrire</button>
      </form>
    </div>
  );
}

export default RegisterForm;
